# MAGIC %md ## H3のセットアップ

# COMMAND ----------

# MAGIC %md ### `trip_h3`テーブル
# MAGIC
# MAGIC > これは、[h3_lonlatash3](https://docs.databricks.com/sql/language-manual/functions/h3_longlatash3.html)を用いた、すべてのH3アプローチのためのポイントテーブルです。
# MAGIC
# MAGIC __注意:__
# MAGIC * より精度の高い分析のために解像度 `12` を使っています(それぞれのセルはNYCにおいて約60ftの直径)が、後で行う追加分析では、[h3_toparent](https://docs.databricks.com/sql/language-manual/functions/h3_toparent.html)製品APIを用いて解像度`10`や`8`をキャプチャします。
# MAGIC * この取り組みのフォーカスである`(pickup_cell)`に対するZ-Orderは、分析内容に応じて、`zorder by (pickup_cell, dropoff_cell)`のように組み合わせのZ-orderingにしたり、別のテーブルの`zorder by (dropoff_cell)`のようにすることができます。

# COMMAND ----------

# MAGIC %sql 
# MAGIC -- この処理は8ワーカーノードなどでは準備に10+分程度必要とします
# MAGIC -- 実行する際には drop & optimize 文のコメントを解除してください
# MAGIC drop table if exists trip_h3;
# MAGIC create table if not exists trip_h3 as (
# MAGIC   select
# MAGIC     h3_longlatash3(pickup_longitude, pickup_latitude, 12) as pickup_cell,
# MAGIC     h3_toparent(h3_longlatash3(pickup_longitude, pickup_latitude, 12), 10) as pickup_cell_10,
# MAGIC     h3_toparent(h3_longlatash3(pickup_longitude, pickup_latitude, 12), 8) as pickup_cell_8,
# MAGIC     
# MAGIC     h3_longlatash3(dropoff_longitude, dropoff_latitude, 12) as dropoff_cell,
# MAGIC     h3_toparent(h3_longlatash3(dropoff_longitude, dropoff_latitude, 12), 10) as dropoff_cell_10,
# MAGIC     h3_toparent(h3_longlatash3(dropoff_longitude, dropoff_latitude, 12), 8) as dropoff_cell_8,
# MAGIC     *
# MAGIC   from (select /*+ REPARTITION(4096) */ * from trip)
# MAGIC );
# MAGIC optimize trip_h3 zorder by (pickup_cell);
# MAGIC select * from trip_h3 where isnotnull(pickup_cell) limit 5;

# COMMAND ----------

df_trip_h3_kepler = (
  spark.table("trip_h3")
  .drop("pickup_latitude", "pickup_longitude", "dropoff_cell", "dropoff_cell_10", "dropoff_cell_8", "dropoff_latitude", "dropoff_longitude")
  .dropna(how="any", subset=["pickup_cell"])
  .sample(.00005)
)
print(f"count? {df_trip_h3_kepler.count():,}")

