# MAGIC %md ### `taxi_zone_h3`テーブル
# MAGIC
# MAGIC > H3-centricアプローチのために [h3_polyfillash3](https://docs.databricks.com/sql/language-manual/functions/h3_polyfillash3.html) を活用します。
# MAGIC
# MAGIC __注意: `(cell)`に対するZ-Orderを実行します__

# COMMAND ----------

# MAGIC %sql 
# MAGIC drop table if exists taxi_zone_h3;
# MAGIC create table if not exists taxi_zone_h3 as (
# MAGIC   select
# MAGIC     explode(h3_polyfillash3(geom_wkt, 12)) as cell,
# MAGIC     properties.borough,
# MAGIC     properties.location_id,
# MAGIC     properties.zone
# MAGIC   from
# MAGIC     taxi_zone
# MAGIC );
# MAGIC optimize taxi_zone_h3 zorder by (cell);
# MAGIC select * from taxi_zone_h3 where location_id > 1 limit 5;

# COMMAND ----------

df_taxi_zone_h3_kepler = spark.table("taxi_zone_h3").filter("location_id = 1")
print(f"count? {df_taxi_zone_h3_kepler.count():,}")

