# MAGIC %md ### `taxi_zone_h3_chip`テーブル
# MAGIC
# MAGIC > H3-Geometry hybridアプローチとしてMosaicの[grid-tessellateexplode](https://databrickslabs.github.io/mosaic/api/spatial-indexing.html#grid-tessellateexplode)を活用します。
# MAGIC
# MAGIC オリジナルのジオメトリを、指定された解像度でいくつかのグリッドインデックスの境界で分割します。指定された解像度で入力ジオメトリをカバーするMosaicチップのセットを返却します。Mosaicチップは以下から構成される構造体タイプです:
# MAGIC <p/>  
# MAGIC
# MAGIC * `is_core`: 当該チップがジオメトリに完全に内包されるかどうかを示します: Boolean
# MAGIC * `index_id`: 設定された空間インデックス(デフォルトはH3)のインデックスID: Integer
# MAGIC * `wkb`: インデックスの形状とオリジナルのジオメトリの共通部分に等しいWKBフォーマットのジオメトリ: Binary
# MAGIC
# MAGIC __注意: `(cell)`に対するZ-Orderを実行します__

# COMMAND ----------

# MAGIC %sql 
# MAGIC -- この処理は複数のワーカーノードなどでは準備に数分を必要とします
# MAGIC -- 実行する際には drop & optimize 文のコメントを解除してください
# MAGIC drop table if exists taxi_zone_h3_chip;
# MAGIC create table if not exists taxi_zone_h3_chip as (
# MAGIC   select
# MAGIC     index.index_id as cell,
# MAGIC     * except(index),
# MAGIC     index
# MAGIC   from (
# MAGIC     select 
# MAGIC       grid_tessellateexplode(geom_wkt, 12),
# MAGIC       properties.borough,
# MAGIC       properties.location_id,
# MAGIC       properties.zone
# MAGIC     from (select /*+ REPARTITION(128) */ * from taxi_zone)
# MAGIC     )
# MAGIC );
# MAGIC optimize taxi_zone_h3_chip zorder by (cell);
# MAGIC select * from taxi_zone_h3_chip limit 5;

# COMMAND ----------

# zip code 10004周辺のlocation_idを取得するために以下を実行します
# これは Financial District の一部です
display( 
spark.table("taxi_zone_h3_chip")
  .withColumn("center_geojson", h3_centerasgeojson("cell"))
  .withColumn("center_x", F.split(F.split(F.split('center_geojson','\[')[1],'\]')[0],',')[0].cast("float")) # <- lon
  .withColumn("center_y", F.split(F.split(F.split('center_geojson','\[')[1],'\]')[0],',')[1].cast("float")) # <- lat
  .filter("center_x >= -74.020") # <- lon
  .filter("center_x <= -73.998") # <-lon  
  .filter("center_y <= 40.712")  # <- lat
  .filter("center_y >= 40.698")  # <- lat
  .select("location_id","zone").distinct().orderBy("location_id").display()
)

# COMMAND ----------

df_taxi_zone_h3_kepler_chip = (
  spark.table("taxi_zone_h3_chip")
    .filter(col("location_id").isin([12,13,209,231,261,33,45,87,88]))
    .select(
      "location_id",
      "zone",
      h3_h3tostring("cell").alias("h3_idx"),
      "index.is_core",
      mos.st_astext("index.wkb").alias("geom_wkt")
    )
)
print(f"count? {df_taxi_zone_h3_kepler_chip.count():,}")
display(df_taxi_zone_h3_kepler_chip.limit(1))

